
DROP TABLE IF EXISTS temp_card_templates;
CREATE TABLE IF NOT EXISTS "temp_card_templates" (
    "order_del" TEXT,
    "template_id_gen" TEXT,
    "name" TEXT,
    "pitch" INT,
    "cost" INT,
    "cost_var" TEXT,
    "power" INT,
    "power_var" TEXT,
    "defense" INT,
    "defense_var" INT,
    "intellect" INT,
    "life" INT,
    "handedness" INT,
    "legendary" BOOLEAN,
    "class" TEXT,
    "type" TEXT,
    "subtypes" TEXT,
    "specialization" TEXT
);
